import React from "react";

class ProfilePage extends React.Component {
  render() {
    return (
      <div className="ProfilePage">
        <img
          src={require("../../resources/images/profile-page-placeholder.png")}
          alt="ifwehadappage"
        />
      </div>
    );
  }
}

export default ProfilePage;
